import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import {Button,Card} from "react-bootstrap";
import "./main.css";


class  Main extends React.Component {
    

    render() {
      return (
        <div className='main'>  
            <Card className='card-container'> 
            <Card.Img />
            <Card.Body className='card.body'>
              <Card.Title className='card.title'>
              Language Activity app
              </Card.Title >
              <Card.Text>
              Welcome to our website : here, people team up and make activites to learn a language together as a community.  People can meet toether to take an online quiz and meet in real live event
            </Card.Text>
            <HomeButton>

                <Button onClick={clickHandler} className='register-button'>Click to register</Button>
            
            </HomeButton>
            </Card.Body>
            </Card>
        </div>
    );
  }
  }
  
  export default Main;
